package daydaychange.p00242;

import org.junit.jupiter.api.Assertions;
import org.junit.jupiter.api.Test;

public class ValidAnagram_ZJKTest {

    ValidAnagram_ZJK validAnagram = new ValidAnagram_ZJK();

    @Test
    public void test1() {
        Assertions.assertEquals(Boolean.TRUE, validAnagram.isAnagram("abc","cba"));
    }

    @Test
    public void test2() {
        Assertions.assertEquals(Boolean.FALSE, validAnagram.isAnagram("abc","cb"));
    }

    @Test
    public void test3() {
        Assertions.assertEquals(Boolean.FALSE, validAnagram.isAnagram("","cba"));
    }

    @Test
    public void test4() {
        Assertions.assertEquals(Boolean.TRUE, validAnagram.isAnagram("",""));
    }

    @Test
    public void test5() {
        Assertions.assertEquals(Boolean.TRUE, validAnagram.isAnagram("abcadds","abcadds"));
    }

    @Test
    public void test6() {
        Assertions.assertEquals(Boolean.FALSE, validAnagram.isAnagram("",""));
    }

}
